import React, { Component } from "react";

class Nav extends Component {
  render() {
    return(
      <div className="nav_container">
        <ul className="nav_ul">
          <span> Hippocampus </span>
          <li> Home </li>
          <li> Flash Cards </li>
        </ul>
      </div>
    )
  }
}

export default Nav;
